import React from 'react';
import {Link, NavLink} from "react-router-dom";

const Navbar = () => {

    return (
        <div className="navBarContainer">

            <div className="cvaNavLogoContainer">
                <Link to="/" className="cvaHome"> CVA Ketenzorg </Link>
            </div>

            <div className="buttonListContainer">
                <div className="buttonContainer"><NavLink to="/Begeleiding" className="cvaNavButtons" style={{color: 'red'}}> Begeleiding </NavLink></div>
                <div className="buttonContainer"><NavLink to="/Professionals" className="cvaNavButtons"> Professionals </NavLink></div>
                <div className="buttonContainer"><NavLink to="/Informatie" className="cvaNavButtons"> Informatie </NavLink></div>
                <div className="buttonContainer"><NavLink to="/Contact" className="cvaNavButtons"> Contact </NavLink></div>
            </div>

        </div>
    )
}

export default Navbar;
